function(){
var regExp = /[\{\}\[\]\/?.;:|\)*`!^\-<>@\#%&\\\=\(\'\"]/gi;
var tmp,eco;
var ecostep =  ["Click","Detail","Add","Remove","Checkout1","Checkout2","Purchase","Refund"];
var cc = new Object();
var cd = [];
var i =  window.dataLayer.length-1;
while( i > 0){
    if(window.dataLayer[i].event === "ga_event"){
      for(var j = 0;  j < ecostep.length; j++){
      if(window.dataLayer[i].layerAction === ecostep[j]){
         if(ecostep[j] === "Checkout1" || ecostep[j] === "Checkout2"){
            ecostep[j] = ecostep[j].charAt(0).toLowerCase() + ecostep[j].slice(1).substring(0,7);
            cc = window.dataLayer[i].ecommerce[ecostep[j]].actionField;
         }else{
            ecostep[j] = ecostep[j].charAt(0).toLowerCase() + ecostep[j].slice(1);
            cc = window.dataLayer[i].ecommerce[ecostep[j]].actionField;
         }        
        }
      }
      cd.push(cc.id);    
      tmp = JSON.stringify(cd);
      if(regExp.test(tmp)){
        var q = tmp.replace(regExp, "");
        if(q == "null"){return undefined}
        else {return q}
    }}
    i--
    }
}

