function() {
    var batchVariableName = '_impressions_batch';
    var ecomObj = {
      ecommerce: {},
      impressions: window[batchVariableName] || []
    };
    var event = {{Event}};

	var obj = {{ga_impressions_GetObject}};

    if (['goodsListClick', 'gtm.click'].indexOf(event) > -1 && obj !== null) {
      var checkClickImpressionVariableName = '_impressions_check_click_impressions';
      if (!window[checkClickImpressionVariableName]) {
        var batchAllVariableName = '_impressions_batch_all';
        var batchAll = window[batchAllVariableName] || [];
        if (!ecomObj.impressions.some(function (impression) {
          return impression.id == obj.id;
        }) && !batchAll.some(function (impression) {
          return impression.id == obj.id;
        })) {
          ecomObj.impressions.push(obj);
        }
        window[batchVariableName] = ecomObj.impressions;
        window[checkClickImpressionVariableName] = true;
      }

      var list = obj.list;
      delete obj.list;

      ecomObj.click = { 
        actionField: { 'list': list }, 
        products: [obj]
      };
    }

    return { ecommerce: ecomObj };
}

function() {
    var pageId = {{ga_dimension20}};

    var targetElement = {{Click Element}};

	if (typeof targetElement === 'undefined') {
      return null;
    }

	var targetElementObj = $({{Click Element}}).closest("[data-goodsno]");
	var list = targetElementObj.data('list');
	var id = targetElementObj.data('goodsno');
	var price = targetElementObj.data('price');
	var dimension17 = targetElementObj.data('dimension17');
	var dimension18 = targetElementObj.data('dimension18');
    var position = targetElementObj.index() + 1;
    var brand = targetElementObj.data('brand');

    if (list === null || list === undefined) {
      list = pageId;
    }

    if (list === '/brand/brandshop/cody' && dimension18 === '관련상품') {
      dimension18 = '착용상품';
    } else if (list === '/contents/curating/main' && dimension18 === '관련상품') {
      dimension18 = '상품';
    } else if (list === '/event/newbrand/main' && dimension18 === '관련상품') {
      dimension18 = '상품';
    } else if (list === '/sale/coupon' && dimension18 === '상품') {
      dimension18 = '적용상품';
    } else if (list === '/magazine/market' && dimension18 === '스토어상품') {
      dimension18 = '관련상품';
    }

	return {
      'list': list,
      'price': price,
      'dimension17': dimension17,
      'dimension18': dimension18,
      'id': id,
      'position': position,
      'brand' : brand
    };
}

function() {
  var pageIdVariableName = '_ga_pageid';
  var pageId = window[pageIdVariableName] || null;

  if (pageId !== null) {
    return pageId;
  }

  var pathname = location.pathname.replace(/\/+$/, "");
  if ($.trim(pathname) === '') {
    pathname = '/app';
  }

  if (location.hostname == 'search.musinsa.com') {
      pathname = '/search';
  }

  switch (pathname) {
    case "/app":
      var pan;
      var isMagazine = ['m.musinsa.com', 'www.musinsa.com', 'musinsa.com', 'magazine.musinsa.com'].indexOf(location.hostname) >= 0;
      var searchParam = location.search === "" ? {} : JSON.parse(
        '{"' +
        decodeURI(
          location.search
          .substring(1)
          .replace(/&/g, '","')
          .replace(/=/g, '":"')
        ) +
        '"}'
      );
      if (searchParam.hasOwnProperty('menu_id')) {
        pan = $('#mobileMain .menuHead nav > .ui-top-menu:not(.swiper-slide-duplicate)[data-menu-id=' + searchParam.menu_id + ']');
      } else if (isMagazine) { 
        pan = $('.headMenuBox .menu > li.active');
      } else {
        pan = $('#mobileMain .menuHead nav > .ui-top-menu:not(.swiper-slide-duplicate).active');
      }
      if (pan.length < 1) {
        return null;
      }
      var clearPageId = function () {
        window[pageIdVariableName] = null;
      }
      pan.parent().children().off('click', clearPageId).on('click', clearPageId);
